import "./app.css"
function Task2(props){
    return(
        <div style={{ BackGroundColor:"red", width:"200PX",height:"300px"}} >
        <h3>ID={props.id}</h3>
        <h3>NAME={props.name}</h3>
        <h3>CITY={props.city}</h3>
        <h3>STATE={props.state}</h3>
        <h3>MOBILE.NO={props.mobile}</h3>
        </div>
    )
}
export default Task2;
